import React from "react"

const Foodcard = ({ img, desc, heading, alt, ingredients }) => {
  return (
    <div className="foodcard" style={{ backgroundImage: { img } }}>
      <h1>{heading}</h1>
      <p>{desc}</p>
      <ul>
        <li>{ingredients}</li>
      </ul>
    </div>
  )
}
export default Foodcard
